import React from 'react';
import { View, TextInput, Button, StyleSheet } from 'react-native';
import { Text } from 'react-native-elements';

const Login = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <Text style={styles.label}>Email</Text>
      <TextInput label="Email" placeholder="Email" style={styles.input} />

      <Text style={styles.label}>Senha</Text>
      <TextInput label="Senha" placeholder="*********" style={styles.input} />

      <Button title="Entrar" style={styles.button} />

      <Text onPress={() => navigation.navigate('Register')}>Registre-se</Text>
    </View>
  );
};

export default Login;

const styles = StyleSheet.create({
  container: {
    height: '100%',
    backgroundColor: 'rgb(255, 255, 255)',
    padding: 30,
  },
  label: {
    marginLeft: 15,
    marginBottom: 10,
  },
  input: {
    backgroundColor: 'rgb(245, 245, 245)',
    borderRadius: 15,
    paddingHorizontal: 15,
    paddingVertical: 10,
    marginBottom: 30,
  },
  button: {
    backgroundColor: 'rgb(248, 110, 69)',
  },
});
